import { CodeIcon } from "@heroicons/react/solid";
import React from "react";
import { projects } from "../data";
import {
  Box,
  Container,
  Grid,
  GridItem,
  Heading,
  Text,
  Link,
  Image,
  useColorMode,
} from "@chakra-ui/react";

export default function Projects() {
  const { colorMode } = useColorMode();

  return (
    <Box
      id="projects"
      bg={colorMode === "light" ? "gray.100" : "gray.900"}
      color={colorMode === "light" ? "gray.800" : "gray.400"}
      py={20}
    >
      <Container
        maxW="container.xl"
        mx="auto"
        px={{ base: 4, md: 10 }}
        textAlign="center"
      >
        <Grid justify="center" align="center" mb={8}>
          <CodeIcon className="inline-block w-6 h-6 mb-4" height={100} />
          <Heading
            as="h1"
            fontSize={{ base: "2xl", md: "3xl", lg: "4xl" }}
            mb={4}
            color={colorMode === "light" ? "gray.900" : "white"}
          >
            Graphics Design
          </Heading>
          <Text
            fontSize={{ base: "md", md: "lg" }}
            mb={8}
            color={colorMode === "light" ? "gray.600" : "gray.400"}
          >
            As a graphics designer, I've created a variety of projects that
            showcase my skills in visual design and creativity. From logos to
            brochures, I've got you covered.
          </Text>
        </Grid>
        <Grid
          templateColumns={{ base: "repeat(1, 1fr)", md: "repeat(3, 1fr)" }}
          gap={8}
        >
          {/* YouTuber Thumbnails */}
          {projects
            .filter((project) => project.type === "youtuber")
            .map((project) => (
              <GridItem key={project.image}>
                <Link href={project.link}>
                  <Box
                    bg={colorMode === "light" ? "gray.200" : "gray.800"}
                    color={colorMode === "light" ? "gray.600" : "gray.400"}
                    p={4}
                    border="1px solid"
                    borderColor={
                      colorMode === "light" ? "gray.200" : "gray.800"
                    }
                    borderRadius="lg"
                    boxShadow="lg"
                    _hover={{
                      position: "relative",
                      overflow: "hidden",
                    }}
                  >
                    <Image
                      src={project.image}
                      alt="project image"
                      w="full"
                      h={{ base: "150px", md: "200px" }}
                      objectFit="cover"
                      objectPosition="center"
                      borderRadius="lg"
                      _hover={{
                        transform: "scale(1.1)",
                        transition: "transform 0.3s ease-in-out",
                      }}
                    />
                  </Box>
                </Link>
              </GridItem>
            ))}
        </Grid>
        <Grid
          templateColumns={{ base: "repeat(1, 1fr)", md: "repeat(3, 1fr)" }}
          gap={8}
          mt={8}
        >
          {/* Logos */}
          {projects
            .filter((project) => project.type === "logo")
            .map((project) => (
              <GridItem key={project.image}>
                <Link href={project.link}>
                  <Box
                    bg={colorMode === "light" ? "gray.200" : "gray.800"}
                    color={colorMode === "light" ? "gray.600" : "gray.400"}
                    p={4}
                    border="1px solid"
                    borderColor={
                      colorMode === "light" ? "gray.200" : "gray.800"
                    }
                    borderRadius="lg"
                    boxShadow="lg"
                    _hover={{
                      position: "relative",
                      overflow: "hidden",
                    }}
                  >
                    <Image
                      src={project.image}
                      alt="project image"
                      w="full"
                      h={{ base: "150px", md: "200px" }}
                      objectFit="cover"
                      objectPosition="center"
                      borderRadius="lg"
                      _hover={{
                        transform: "scale(1.1)",
                        transition: "transform 0.3s ease-in-out",
                      }}
                    />
                  </Box>
                </Link>
              </GridItem>
            ))}
        </Grid>
        <Grid
          templateColumns={{ base: "repeat(1, 1fr)", md: "repeat(3, 1fr)" }}
          gap={8}
          mt={8}
        >
          {/* Social Media Pictures */}
          {projects
            .filter((project) => project.type === "socialmedia")
            .map((project) => (
              <GridItem key={project.image}>
                <Link href={project.link}>
                  <Box
                    bg={colorMode === "light" ? "gray.200" : "gray.800"}
                    color={colorMode === "light" ? "gray.600" : "gray.400"}
                    p={4}
                    border="1px solid"
                    borderColor={
                      colorMode === "light" ? "gray.200" : "gray.800"
                    }
                    borderRadius="lg"
                    boxShadow="lg"
                    _hover={{
                      position: "relative",
                      overflow: "hidden",
                    }}
                  >
                    <Image
                      src={project.image}
                      alt="project image"
                      w="full"
                      h={{ base: "150px", md: "200px" }}
                      objectFit="cover"
                      objectPosition="center"
                      borderRadius="lg"
                      _hover={{
                        transform: "scale(1.1)",
                        transition: "transform 0.3s ease-in-out",
                      }}
                    />
                  </Box>
                </Link>
              </GridItem>
            ))}
        </Grid>
      </Container>
    </Box>
  );
}
